syntax = "proto3";

import "ItemParam.proto";

message TakeCityReputationLevelRewardRsp {
	enum CmdId {
		option allow_alias = true;
		NONE = 0;
		ENET_CHANNEL_ID = 0;
		ENET_IS_RELIABLE = 1;
		CMD_ID = 2883;
	}

	int32 retcode = 7;
	uint32 city_id = 2;
	uint32 level = 3;
	repeated ItemParam item_list = 10;
}
